// ========================
// ProductService Interface
// ========================

type ProductService interface {
	GetProduct(context.Context, *cm.IDRequest) (*Product, error)

	// GetProducts
	//
	// All price use for variant so when filter by price, you should add prefix 'v.'
	// Example: v.wholesale_price
	GetProducts(context.Context, *GetVariantsRequest) (*ProductsResponse, error)

	GetProductsByIDs(context.Context, *cm.IDsRequest) (*ProductsResponse, error)

	UpdateProduct(context.Context, *UpdateProductRequest) (*Product, error)

	UpdateProductImages(context.Context, *UpdateVariantImagesRequest) (*Product, error)

	GetVariant(context.Context, *cm.IDRequest) (*Variant, error)

	// GetVariants
	//
	// Return list of variants.
	//
	// Filters:
	//   - Text or set: s_name, x_name, s_tags
	//   - Exactly: x_code, x_base_id, x_id, supplier_id, category_id, x_status, s_status, e_status, status
	//   - Numeric: wholesale_price, list_price, retail_price_min, retail_price_max, s_wholesale_price, s_list_price, s_retail_price_min, s_retail_price_max, x_price
	GetVariants(context.Context, *GetVariantsRequest) (*VariantsResponse, error)

	GetVariantsByIDs(context.Context, *cm.IDsRequest) (*VariantsResponse, error)

	UpdateVariant(context.Context, *UpdateVariantRequest) (*Variant, error)

	UpdateVariants(context.Context, *UpdateVariantsRequest) (*UpdateVariantsResponse, error)

	UpdateVariantsStatus(context.Context, *UpdateVariantsStatusRequest) (*cm.UpdatedResponse, error)

	UpdateVariantImages(context.Context, *UpdateVariantImagesRequest) (*Variant, error)
}

